import React from "react";
import { Container, Form, Navbar, InputGroup } from "react-bootstrap";
import { BsFillSearch } from 'react-icons/bs';

function NavBar() {
  return (
    <Navbar expand="lg" className="bk">
      <Container>
        <Navbar.Brand href="#">
          <img src="logo.jpg" className="logo" alt="logo" />
        </Navbar.Brand>
        <Form className="d nav-style">
          <InputGroup>
            <Form.Control
              style={{ boxShadow: "none", border: "2px solid red" }}
              type="text"
              placeholder="ابحث"
              className="me-2 w-100"
              aria-label="Search"
            />
            <InputGroup.Append>
              <InputGroup.Text>
                <BsFillSearch />
              </InputGroup.Text>
            </InputGroup.Append>
          </InputGroup>
        </Form>
      </Container>
    </Navbar>
  );
}

export default NavBar;
